import Back from "../../common/Back/Back"
import img from "../../../../assets/img/backgroundPost.jpg"
import classes from "./RentRequest.module.css"
import RentRequestCard from "./RentRequestCard"
import { useState, useEffect, useContext } from "react"
import AuthContext from '../../../../store/auth-context';
import {getAllRentRequestFromTenant} from "../../../../api//RentRequestApi"

const ManagerHouse = () => {
    const authCtx = useContext(AuthContext)
    
    const [requests, setRequests] = useState([])
    
    useEffect(() => {
        getAllRentRequestFromTenant(authCtx.token)
        .then((data) => {
            console.log(data)
            const tempData = []
            data.forEach(item => {
                tempData.push({
                    id: item.id,
                    cover: item.image,
                    location: `${item.city} - ${item.district} - ${item.ward}`,
                    category: item.category.name,
                })
            })
            setHouses(tempData)
        })
        .catch((err) => {
                alert(err.message);
        });
    }, [])
  
    return (
        <section>
            <Back name='Rent Request' title='Your Rent Request' cover={img}/>
            <section className={`${classes.recent} ${classes.padding}`}>
                <div className={classes.container}>
                    <div className={`${classes.grid1} ${classes.mtop}`}>
                        {houses.map((item, index) => <RentRequestCard item={item} index={index}/>)}
                    </div>
                </div>
            </section>
        </section>
    )
}

export default ManagerHouse;
